import './App.css';

function App() {
  return (
    <div className="App">
      <nav id="mainNavbar" className="navbar navbar-dark bg-dark navbar-expand-md">
        <a href="#" className="navbar-brand">CANDY</a>
        <button className="navbar-toggler" data-toggle="collapse" data-target="#navLinks">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navLinks"></div>
      </nav>
    </div>
  );
}

export default App;
